script: |
  super -f text -I q12731.spq | sort > q12731.out

inputs:
  - name: q12731.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE - col0 BETWEEN - col0 - - 51 + + - 64 * ( + col0 ) AND + - col2;
  - name: tab2

outputs:
  - name: q12731.out
    data: |
      46	51	23
      64	77	40
      75	67	58
